import React from "react";
 

const Kisi = (prop) => {
  const { isim, img, yas, kurs } = prop;

  

  return (
    
      <div >
      <h1 style={{padding:"1rem" }}>{isim}</h1>
      <img src={img} alt="" width={100} height={100}  style={{padding:"1rem" }}/>
      <h4 style={{padding:"1rem" }}>{yas}</h4>
      <h4 style={{padding:"1rem" }}>{kurs}</h4>
      
    </div>
    
  );
};

export default Kisi;
